  const user = useSelector((state) => state.user.userData);

  return (
    <div>
      <h1>WRITE PAGE</h1>
      <hr></hr>
      {user ? (
        <div>
          userlogined
          <WriteBarrierIconContainer></WriteBarrierIconContainer>
          <ImageUploader></ImageUploader>
          <EditorContainer></EditorContainer>
        </div>
      ) : (
        <div>notlogined</div>
      )}
    </div>
  );
};

